import React from "react"


class HeaderSub extends React.Component{



    render(){
        return(
            <div className="container-sub-nav">
                <h3>SHOP BY OCCASION</h3>
                <ul className="sub-nav">
                    <li>Bussiness</li>
                    <li>Casual</li>
                    <li>Weddings</li>
                    <li>Formal</li>
                </ul>
                <ul className="sub-nav">
                    <li>SHOP BY PRODUCT</li>
                    <li>Suits</li>
                    <li>Shirts</li>
                    <li>Trousers</li>
                    <li>Vests</li>
                    <li>Accessories</li>
                    <li>Shoes</li>
                </ul>
            </div>
        );
    }

}

export default HeaderSub;
